import { useNavigate } from "react-router-dom"
import { useState } from "react";
import "./../css/LogInPage.css"; 
import Popup from "./Popup";

const LogInPage = () => {
    const [username, setUsername] = useState("")
    const [password, setPassword] = useState("")
    const [popup, setPopup] = useState({active: false, title: "", message: ""});
    
    const validateInputSignUp = async () => {
        if(!username) {
            setPopup({active: true, title: "Oops!", 
                message: "Username can't be empty"})
            return false
        }
        if(!password) {
            setPopup({active: true, title: "Oops!", 
                message: "Password can't be empty"})
            return false
        }
    }
    
    const onRegisterClick = async (e) => {
        e.preventDefault()
    }

    const onLoginClick = async (e) => {
        e.preventDefault()
    }

    return(
        <div classname="login-page">
            <div className='login-texts'>
                <p className='logo-text-login-page'>Food Panda</p>
                <p className='motto'>Reborn</p>
            </div>
            <form classname="login-form">
                <div classname="user-data">
                    <label classname="user-data-label">Username:</label>
                    <input
                        classname="user-data-input"
                        type="text"
                        placeholder="Your username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                    />
                </div>
                <div className="user-data">
                    <label className="user-data-label">Password:</label>
                    <input
                        className="user-data-input" 
                        type="password" 
                        placeholder="Your password"
                        value={password} 
                        onChange={(e) => setPassword(e.target.value)} 
                    />
                </div>
                
                <button 
                    className='btn' 
                    id='btn-login' 
                    type='submit'
                    onClick={(e) => onLoginClick(e)}
                >
                    Login        
                </button>  
                <button 
                    className='btn' 
                    id='btn-register' 
                    onClick={(e) => onRegisterClick(e)}
                >
                    Register       
                </button>
            </form>
        </div>
    )
}

export default LogInPage
